import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import API from "../api";

export default function MovieDetail() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [movie, setMovie] = useState(null);

  useEffect(() => {
    const load = async () => {
      try {
        const res = await API.get(`movies/${id}/`);
        setMovie(res.data);
      } catch (err) {
        console.error(err);
      }
    };
    load();
  }, [id]);

  if (!movie) return <div className="text-center mt-10 text-lg text-gray-200">Loading...</div>;

  const deleteMovie = async () => {
    const confirmDelete = window.confirm("Delete this movie permanently?");
    if (!confirmDelete) return;
    try {
      await API.delete(`movies/${id}/`);
      navigate("/");
    } catch (err) {
      console.error(err);
      alert("Error deleting movie");
    }
  };

  return (
    <div className="min-h-screen px-6 py-10 flex justify-center bg-gradient-to-br from-[#0f1b33] via-[#071120] to-[#000814] text-white">

      <div className="max-w-5xl w-full flex flex-col md:flex-row gap-10 backdrop-blur-xl bg-white/5 p-8 rounded-2xl shadow-[0_0_30px_rgba(0,0,0,0.5)] border border-white/10">

        {movie.poster && (
          <img
            src={movie.poster}
            alt={movie.title}
            className="w-[240px] h-[340px] object-cover rounded-2xl shadow-[0_10px_35px_rgba(0,0,0,0.55)]
            transition-transform duration-300 hover:scale-105 hover:shadow-[0_15px_50px_rgba(0,0,0,0.75)]"
          />
        )}

        <div className="flex flex-col text-right w-full justify-center">

          <h2 className="text-5xl font-extrabold mb-4 bg-gradient-to-r from-[#3da9fc] to-[#89e0ff] bg-clip-text text-transparent">
            {movie.title}
          </h2>

          <p className="text-lg">
            <span className="text-cyan-300 font-semibold">Release:</span>{" "}
            {movie.release_date || "Unknown"}
          </p>

          <p className="text-lg mt-1">
            <span className="text-cyan-300 font-semibold">Rating:</span>{" "}
            {movie.rating || "N/A"}
          </p>

          <p className="mt-6 text-gray-300 leading-relaxed text-justify">{movie.description}</p>

          <button
            onClick={deleteMovie}
            className="mt-8 self-end py-3 px-6 bg-gradient-to-r from-red-600 to-pink-600 hover:from-red-700 hover:to-pink-700 
            text-white text-lg rounded-xl shadow-[0_8px_20px_rgba(255,70,100,0.4)]
            transition-transform duration-300 hover:scale-105"
          >
            Delete Movie
          </button>
        </div>
      </div>
    </div>
  );
}
